e_Ring','Gear score default value for defVal_S84-Grade_Ring equippable item type.','0','1'), ('GearScore','defVal_S84-Grade_Shield','Gear score default value for defVal_S84-Grade_Shield equippable item type.','0','1'), ('GearScore','defVal_S84-Grade_Sword','Gear score default value for defVal_S84-Grade_Sword equippable item type.','0','1'), ('Scheduler','delayBetweenEvents','The delay it takes to start a new main event after one ended. In minutes.','30','1'), ('Core','detailedDebug','Enables detailed debugging of every action the events does. Use this if you are having any difficulities with something and then send to hNoke (it is written to log/NexusEvents_detailed.log file).','true','1'), ('Core','detailedDebugToConsole','If the \'detailedDebug\' config is enabled, this can also make the detailed debug be shown into Debug Console. This is recommended only for developing environment.','false','1'), ('Core','devMode','Enables loading HTML files from folders, etc.','false','1'), ('Scheduler','enableAutomaticScheduler','Enable / Disable the automatic event scheduler when the server starts (true to enable, false to disable).','true','1'), ('GearScore','enableGearScore','Enables Gear-score engine.','true','1'), ('Features','enableGlobalStatistics','Enable/disable the global statistics engine here. The players will still be able to view the personal statistics (personal statistics are easy on resources, global statistics might be a more expensive).','true','1'), ('Features','enableStatistics','Enable/disable the whole statistics engine here.','true','1'), ('Features','enableUnregistrations','You can permit players to unregister from their event here.','true','1'), ('Features','eventSchemeBuffer','Enables automatic scheme-based event buffer. The players are rebuffed with their schemes on event/round start or revive. Put \'true\' or \'false\'.','true','1'), ('Scheduler','firstEventDelay','The delay it takes to start a first main event after the server starts. In minutes.','10','1'), ('Core','globalEventManagerId','Global Event NPC Manager ID.','9993','1'), ('Features','globalStatisticsRefresh','In seconds. The delay after which data will be reloaded from database and sorted. Do not use small values for big servers.','1800','1'), ('Core','logToFile','Enables logging all engine\'s messages (even if you have turned debugging off) to NexusEvents.log file in log directory.','true','1'), ('Core','mainEventManagerId','Main Events NPC Manager ID.','9999','1'), ('Core','mapGuardNpcId','The NPC ID of the automatic NPC MapGuard. This NPC may be useful to prevent players from escaping the map - It will kill all players on sight! The MapGuard will be spawned on Spawn of type \'MapGuard\'. To disable spawning MapGuard NPCs, set this to -1.','9996','1'), ('Buffer','maxBuffsCount','The max count of buffs player can take from nexus buffer.. Put -1 to make this value loaded from the gameserver configs.','-1','1'), ('Features','maxBuffsPerPage','You can specify here how many buffs in the event buffer (shown in registration NPC) will there be per one page. Default and safe value should be 12, but you may want to decrease it for Interlude.','12','1'), ('Buffer','maxDancesCount','The max count of dances player can take from nexus buffer. Put -1 to make this value loaded from the gameserver configs. Put 0 to count dances as buffs.','-1','1'), ('Features','maxWarnings','How many warning points must to player have to disallow him access to all events. Player gets warning points when he for example disconnects from event. Warnings decrease by 1 every day.','3','1'), ('Core','miniEventsManagerId','Mini Events NPC Manager ID.','9998','1'), ('Core','npcBufferId','If you want, The NPC ID of your custom buffer NPC. This NPC will be spawned in your mini events on Spawn of type \'Buffer\'. To disable spawning buffer NPCs, set this to -1.','9997','1'), ('Features','pvpPointsOnKill','You can specify whether the players will receive PvP points for killing on events.','false','1'), ('Features','registerVoicedCommand','The command to register the player to the event remotely.','.register','1'), ('Features','removeCubicsOnDie','You can specify here if the cubics will be removed from the player (while he is in event) when he dies.','true','1'), ('Features','setNeutralSkills','<font color=5f5f5f>(Requires additional core modifications!)</font> Skills written here will be usable on both teammates and enemies. Useful for example for skill Rush (ID 994), which is by default not offensive, and thus the engine doesn\'t allow the player to cast it on his opponent. Write only IDs and separate by \';\', example: <font color=LEVEL>SKILL1;SKILL2;SKILL3</font>.','994','2'), ('Features','setNotOffensiveSkills','<font color=5f5f5f>(Requires additional core modifications!)</font> Skills written here will be usable only on player\'s teammates (not opponents/enemies) during events. Write only IDs and separate by \';\', example: <font color=LEVEL>SKILL1;SKILL2;SKILL3</font>.','','2'), ('Features','setOffensiveSkills','<font color=5f5f5f>(Requires additional core modifications!)</font> Skills written here will be usable only on player\'s opponents/enemies (not teammates) during events. Write only IDs and separate by \';\', example: <font color=LEVEL>SKILL1;SKILL2;SKILL3</font>.','','2'), ('Features','showNextEventName','Specify here whether you want to show (in the registration NPC) the name of the next scheduled event.','true','1'), ('Features','showNextEventTime','Specify here whether you want to show (in the registration NPC) when does the next scheduled event start.','true','1'), ('Scheduler','spawnRegNpcCords','The x, y, z cords specifiying where the registration NPC will be spawned when an event is started by the automatic scheduler (format: x;y;z).','83435;148635;-3405','2'), ('Features','statsDetailedPlayerInfo','Enables some extra statistics about player, such as PvP kills, clan name, ally name, level, class name. Btw, html page looks much better if this is enabled ;).','true','1'), ('Features','statsIgnoreBanned','True to not show banned players in statistics.','true','1'), ('Features','statsIgnoreGMs','True to not show GMs in statistics.','true','1'), ('Features','statsPlayersPerPage','Count of players shown on one page of global statistics. Default: 12.','12','1'), ('Features','statsShowPkCount','Specify whether player\'s PK count will be shown in his statistics.','true','1'), ('Features','statsSorting','Define available types of sorting data in the global statistics engine. Write: <font color=LEVEL>simple</font> to allow sorting by name and level; <font color=LEVEL>advanced</font> to allow sorting by name, level, count of played events and K:D ratio; <font color=LEVEL>full</font> to allow full sorting possibilities (including score count, deaths, etc.). The more complex is the sorting method, the more is the engine expensive on resources.','full','1'), ('Features','statTrackingEnabled','Stats Tracking.','false','1'), ('Features','teleToEventDelay','The delay to wait to teleport players to the event after the registration ended. In ms. Default 10000, max 60000.','10000','1'), ('Features','unregisterVoicedCommand','The command to unregister the player from the event remotely.','.unregister','1');
